	private static ItemValue join(ValueType type, String... arrays) {
		return ItemValue.builder()
					.valueType(type)
					.withPath(StringUtils.join(arrays, DEFAULT_SEPERATOR))
					.beFixedItem();
	}
	
	private static String joinS(String... arrays) {
		return StringUtils.join(arrays, DEFAULT_SEPERATOR);
	}
	
	private static String joinNS(String... arrays) {
		return StringUtils.join(arrays);
	}
